        <Container>
            <div style={{ marginBottom: '20px' }}>
                <h2>Daftar Buku</h2>
            </div>
    <Table striped bordered hover>
      <thead>
        <tr className='text-center'>
          <th>No</th>
          <th>Nama Buku</th>
          <th>Deskripsi</th>
          <th>Harga Buku</th>
        </tr>
      </thead>
      <tbody>
        
      </tbody>
            </Table>
            </Container>
  );
}

export default BasicExample;
